import React from 'react'

const ShowPersons = (props) => {
    <div>
    <ul>
    {props.personsToShow.map(person =>
      <li key = {person.name}> {person.name} {person.number} </li>
    )}
    </ul>
    </div>
}
    
export default ShowPersons
